const Orderlist = ({ orders, name }) => {
   
    return ( 
        <div className="order-list">
            <h2> { name } </h2>
             {orders.map((order) => (
                <div className="order-preview" key={order.id}>
                    <h2>In the {order.marketName}</h2>
                    <p>Mr {order.client} order {order.name}</p>
                </div>
            )

            )

             }
        </div>
     );
}
 
export default Orderlist;
